import React, {Component} from 'react';
import skills from './skills'

class Skills extends Component{
    constructor(){
        super();
    }

    render(){
        const skillRow = skills.map((card,i)=>{
            return <Card key={i} card={card} />
        })

        console.log(skills[0]);
        return(
            <div>
                <h2>Sample</h2>
                {skills[0]}
            </div>
        )
    }
}

export default Skills;
